import { inputUsername, handleUsernameChange, handleConfirmUser } from '../src/App';

export default function Home() {
  // Use the imported variables and functions here
  return (
    <div className="home">
      <h2> Welcome</h2>
      <div className="input-group">
        <input
          type="text"
          value={inputUsername}
          onChange={handleUsernameChange}
        />
        <button onClick={handleConfirmUser}>Confirm</button>
      </div>
    </div>
  );
}
